// src/pages/CalendarPage.js
import {React} from 'react';
import { Box, TextField, Typography } from '@mui/material';
import BasicDatePicker from '../components/EntryForm/EntryDatePicker';
import MultilineTextFields from '../components/EntryForm/EntryMultilineTextField';
import BasicTextFields from '../components/EntryForm/EntryTextField';
import SelectVariants from '../components/EntryForm/EntrySelectField';
import {useForm} from 'react-hook-form';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { Button } from '@mui/material';
import Checkboxes from '../components/EntryForm/EntryCheckBox';



const Entry = () => {
  const {handleSubmit,reset,setValue,control} = useForm()
  const submission = (data) => console.log(data)
  return (

  <div>
    <form onSubmit={handleSubmit(submission)}>

    <Box sx={{display:'flex', width: '100%', backgroundColor: '0003f', marginBottom: '10px'}}>
      <Typography sx={{marginLeft: '20px', color: '#fffff'}}>
        Start a New Journal Entry
      </Typography>
    </Box>

    <Box sx={{display:'flex', width: '100%', boxShadow: 3, padding: 4 ,flexDirection: 'column'}}>

    <Box sx={{display:'flex', justifyContent:'space-around'}}>
        
        <BasicDatePicker
          label="Date"
          name="date"
          control ={control}
        />

        <MultilineTextFields
          label = "Name" 
          name="name"
          control={control}
          placeholder="Provide an entry name" 
        />

        <SelectVariants
          name = "age"
          control = {control}>
        </SelectVariants>

        <Checkboxes
          name="proper_nutrition"
          control = {control}

          />
        
        


      </Box>
      <Box> 
        
        <Button variant="contained" type="submit" sx = {{width:'100%'}}>
          Submit
        </Button>
      </Box>


    </Box>
    </form>

  </div>
  )
  };
export default Entry;
